import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="hero">
      <h1>Welcome to the Patient Management System</h1>
      <p>Easily manage patient information with our intuitive platform.</p>
      
      <div className="button-container">
        <button onClick={() => window.location.href = "/AddPatient"}>Add New Patient</button>
        <button onClick={() => window.location.href = "/update"}>Update Existing Patient</button>
      </div>
    </div>
  );
}

export default Home;
